const name = "Hi";
const n = "Born"

// ES6
// {{`${name} {n}`}}
// ReactDOM.render(<div><h1>Hello {name+" "+n}!</h1><p>Your Lucky Number is {Math.floor(Math.random()*10)}</p></div> ,document.getElementById('root'));

// CHALLENGE
var today = new Date();
var dd = String(today.getDate()).padStart(2, '0');
var mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
var yyyy = today.getFullYear();

today = mm + '/' + dd + '/' + yyyy;

ReactDOM.render(<div><p>Created by {name} {n}.</p><p>Copyright {today}</p></div> ,document.getElementById('root'));
